import React, { useState, useEffect } from "react";
import PropTypes from "prop-types";
import PricingRow from "./PricingRow";
import "./DaisyComponents.css";

function ProfessionalsSection({ sliceRange, cardTitle }) {
  const [professionals, setProfessionals] = useState([]);

  useEffect(() => {
    async function fetchProfessionals() {
      try {
        const response = await fetch("http://localhost:8000/api/random-users/");
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        const data = await response.json();
        setProfessionals(data.slice(sliceRange[0], sliceRange[1]));
        console.log('Professionals:', data.slice(sliceRange[0], sliceRange[1])); // Log the updated value here
      } catch (error) {
        console.error("Error fetching professionals:", error);
      }
    }
    fetchProfessionals();
  }, [sliceRange]);

  return (
    <>
      <select className="select select-primary w-full max-w-xs">
        <option disabled selected>
          Choose Your Field
        </option>
        <option>Cyber Security</option>
        <option>Data Management</option>
        <option>Software Engineering</option>
        <option>Business Administration</option>
        <option>Accounting</option>
      </select>

      <div className="overflow-x-auto">
        <table className="table">
          {/* head */}
          <thead>
            <tr>
              <th></th>
              <th>Name</th>
              <th>Field</th>
              <th>Session Cost</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {professionals.map((professional, index) => (
              <PricingRow
                key={index}
                firstName={professional.firstName}
                lastName={professional.lastName}
                country={professional.country}
                job={professional.job}
                picture={professional.picture}
              />
            ))}
          </tbody>
          {/* foot */}
          <tfoot>
            <tr>
              <th></th>
              <th>Name</th>
              <th>Field</th>
              <th>Session Cost</th>
              <th></th>
            </tr>
          </tfoot>
        </table>
      </div>
    </>
  );
}

export default ProfessionalsSection;
